import React from 'react'
import Card from '../Card/Card'
const cardComponent = ServiceList.map((service, i) => {
	return <Card 
			key={i}
			id={service[i].id}
			title={service[i].title}
			image={service[i].image}
			description={service[i].description}
		/>
});
const CardList = ({ServiceList}) => {
	return(
		<div>
			{cardComponent}
		</div>
	);
}

export default CardList;
